INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 100, "2030/01/01 14:59:59", 1, 130011, 3001, 2.1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", -416.5, "ヤマト", 3001100, 0.0, 2);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 101, "2030/01/01 14:59:59", 4, 130011, 3001, 5.68, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", -416.5, "ヤマト", 3001101, 0.0, 2);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 102, "2030/01/01 14:59:59", 1, 130011, 3001, 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", -416.5, "ヤマト", 3001102, 0.0, 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 100, "2030/01/01 14:59:59", 1, 130211, 3002, 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", -416.5, "フブキ", 3002100, 0.0, 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 101, "2030/01/01 14:59:59", 1, 130211, 3002, 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", -416.5, "フブキ", 3002101, 0.0, 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 102, "2030/01/01 14:59:59", 5, 130211, 3002, 8.53, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", -416.5, "フブキ", 3002102, 0.0, 2);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 103, "2030/01/01 14:59:59", 7, 130211, 3002, 5.67, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", -416.5, "フブキ", 3002103, 0.0, 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 104, "2030/01/01 14:59:59", 1, 130211, 3002, 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", -416.5, "フブキ", 3002104, 0.0, 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 300, "2030/01/01 14:59:59", 3, 130211, 3004, 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", -416.5, "フブキ", 3002300, 0.0, 3);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 301, "2030/01/01 14:59:59", 7, 130211, 3005, 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", -416.5, "フブキ", 3002400, 0.0, 7);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 200, "2030/01/01 14:59:59", 2, 130211, 3003, 4.4, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", -416.5, "フブキ", 3003200, 0.0, 1);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 201, "2030/01/01 14:59:59", 7, 130211, 3003, 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", -416.5, "フブキ", 3003201, 0.0, 7);
INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES ("2024/10/31 12:00:00", 202, "2030/01/01 14:59:59", 1, 130211, 3003, 5.6, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", -416.5, "フブキ", 3003202, 0.0, 2);
